import React, { Component } from 'react';
import Layout from '../components/layout/layout';
import '../styles/index.scss';
import { BrowserRouter as Router } from 'react-router-dom';

class App extends Component {

  render() {

    return (
      <div className="app">
        <Router >
        <Layout />
        </Router>
      </div>
    )
  }
}

export default App;
